import React from 'react';
import { Nav, Navbar } from 'react-bootstrap';
import styled from 'styled-components';
import './Nav.css';

const Link = styled.span`
    padding: 15px;
`;

export default function NavBar() {
    return (
        <Navbar collapseOnSelect expand="lg" className="nav-style" variant="dark" fixed="top">
            <Navbar.Toggle aria-controls="responsive-navbar-nav" className="ml-auto" />
            <Navbar.Collapse id="responsive-navbar-nav">
                <Nav className="ml-auto">
                    <Nav.Link href="#about" style={{padding:'15px'}}>About</Nav.Link>
                    <Nav.Link href="#timeline" style={{padding:'15px'}}>Timeline</Nav.Link>
                    <Nav.Link href="#projects" style={{padding:'15px'}}>Projects</Nav.Link>
                    <Nav.Link href="#contact" style={{padding:'15px'}}>Contact</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}
